import React from "react";
import Avatar from "./Avatar";
import Detail from "./Detail";

function Card(props) {
  return (
    <div className="card">
        <div className="card-content">
        <h3>{props.name}</h3>
        <Avatar img={props.img} />
        <h2>{props.heading}</h2>
      </div>
    </div>
  );
}

export default Card;
